  const [ view, setView] = useState({ about: true, contact: false, stack: false});




  return (

    <body>
      <div className = "container1 bg-dark">
        <Navbar 
          view = {view}
          setView = {setView}
        />
        <div className = "net">
          <Socialnet/>
        </div>
      </div>

      <div className = "container2 bg-dark">
        <Photo

        />
        <Aboutme/>

        setView({{about: false, contact: false, stack: false}});

        console.log(view);

      </div>

      <Footer/> 
    </body>

  );
}

export default App;
